import React, { Component } from 'react';
import './App.css';
import Clarifai from 'clarifai';
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkFrom/ImageLinkForm';
import Rank from './Components/Rank/Rank';
import Prtls from './Components/Particles/Particles';
import FaceRecognition from './Components/FaceRecognition/FaceRecognition';

const USER_ID = 'hadi_01';
    // Your PAT (Personal Access Token) can be found in the portal under Authentification
    const PAT = '9a0cf551bffe4b2ab6c4c5903d0a6e79';
    const APP_ID = 'First-Application';
    // Change these to whatever model and image URL you want to use
    const MODEL_ID = 'general-image-recognition';
    const MODEL_VERSION_ID = 'aa7f35c01e0642fda5cf400f543e7c40';    
    const IMAGE_URL = 'https://samples.clarifai.com/metro-north.jpg';

    ///////////////////////////////////////////////////////////////////////////////////
    // YOU DO NOT NEED TO CHANGE ANYTHING BELOW THIS LINE TO RUN THIS EXAMPLE
    ///////////////////////////////////////////////////////////////////////////////////

    const raw = JSON.stringify({
        "user_app_id": {
            "user_id": USER_ID,
            "app_id": APP_ID
        },
        "inputs": [
            {
                "data": {
                    "image": {
                        "url": IMAGE_URL
                    }
                }
            }
        ]
    });

    const requestOptions = {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Authorization': 'Key ' + PAT
        },
        body: raw
    };

    // NOTE: MODEL_VERSION_ID is optional, you can also call prediction with the MODEL_ID only
    // https://api.clarifai.com/v2/models/{YOUR_MODEL_ID}/outputs
    // this will default to the latest version_id

    // fetch("https://api.clarifai.com/v2/models/" + MODEL_ID + "/versions/" + MODEL_VERSION_ID + "/outputs", requestOptions)
    //     .then(response => response.text())
    //     .then(result => console.log(result))
    //     .catch(error => console.log('error', error));





class  App extends Component {
  constructor(){
    super();
    this.state={
      input: '',
    }
  }
   onInputChange = (event) => {
    console.log(event.target.value);
    // this.setState({input: event.target.value});
  }

  onTap = ()=>{
    console.log("clicked")
    fetch("https://api.clarifai.com/v2/models/" + MODEL_ID + "/versions/" + MODEL_VERSION_ID + "/outputs", requestOptions)
        .then(response => response.text())
        .then(result => console.log(result))
        .catch(error => console.log('error', error));
  }


  render() {
    return (
      <div className="App">
        <Prtls className="particles"/>
      <Navigation />
       <Logo />
       <Rank />
      <ImageLinkForm 
      onInputChange={this.onInputChange} 
      onTap={this.onTap} />
      <FaceRecognition />
    </div>
  );
}
}

export default App;
